from random import random
# from shapely.geometry import LineString

cases = []

for i in xrange(1, 3):
    for j in xrange(1, i + 1):
        nr = 10 ** i
        nb = 10 ** j
        red = []
        for _ in xrange(0, nr):
            red.append([[random(), random()], [random(), random()]])

        blue = []
        for _ in xrange(0, nb):
            blue.append([[random(), random()], [random(), random()]])

        cases.append(dict(
            name = "Random, red: {}".format( nr) + ", blue: {}".format(nb),
            red  = red,
            blue = blue
        ))


def clipperToGraph(loops):
    edges = []
    for i in xrange(0, len(loops)):
        loop = loops[i]
        for j in xrange(0, len(loop)):
            a = loop[j]
            b = loop[(j + 1) % len(loop)]
            if a[0] == b[0] and a[1] == b[1]:
                continue

            edges.append([[a[0], a[1]], [b[0], b[1]]])
    return edges

def lntups(poly):
    lns = []
    for ln in poly :
        l = [(o['X'], o['Y']) for o in ln]
        lns.append(l)
    return lns

